import React from "react";

function TaskList({ tasks }) {
  const task = tasks.map(task => (
    <li key={task.number}>
      {task.name} {task.number}
    </li>
  ));
  return (
    <div>
      TaskList
      <ul>{task}</ul>
    </div>
  );
}
export default TaskList;
